    "2016-07-27T22:48:45.979545",nt"name": "refining-mussel-conservation-techniques-through-the-operation-of-a-streamside-rearing-trai",nt"isopen":
    false,nt"url": null,nt"notes": "As part of the Genoa National Fish Hatchery
    Native Freshwater Mussel Restoration Program, U.S. Fish and Wildlife Service researchers
    utilized advanced technology in mobile rearing to evaluate how how different water
    sources support growth and survival of young freshwater mussels. A mobile aquatic
    rearing station, or MARS, was deployed along the banks of the Mississippi River
    in Wisconsin in the summer of 2012 to raise rare and endangered mussel species,
    including Higginsu2019 eye pearlymussel, hickorynut, black sandshell and snuffbox.
    Information gathered will provide a knowledge base for the operation of the trailer
    moving forward, and will help ultimately optimize rearing techniques in light of
    expanding natural resource stressors to increase early life stage survival of these
    ecologically-essential freshwater animals.",nt"license_title": "License Not
